INSERT INTO achievements (id, award, details, notes, created, modified, awardbody_id, level) VALUES
	(1, 'Octopus 1', e'The Octopus series is an exciting series of 3 progressive awards specifically designed for child aged between 5 to 8 years old.\\r\\n\\r\\nThis enables older children to access the Learn to Swim pathway and develop their confidence, knowledge and skills. We believe the best way to achieve this is to create safe environments in which children can be introduced to the water whilst having fun and by providing a progressive learn to swim programme that is both challenging and rewarding.\\r\\n\\r\\nOn completion of the Octopus series, learners can progress through the Learn to Swim journey and move on to the Goldfish, Angelfish and Shark series. A child\U00002019s first learn to swim experience is one of the most important in terms of capturing and retaining their interest.', 'Swimming teacher or assistant in water is optional. Buoyancy aids may be used.', '2017-05-04 10:24:17+00:00', '2017-05-03 10:24:17+00:00', 2, 'beginner'),
	(2, 'Octopus 2', 'The Octopus series is an exciting series of 3 progressive awards specifically designed for child aged between 5 to 8 years old.', 'Swimming teacher or assistant in water is optional. Buoyancy aids may be used.', '2017-05-03 10:24:25+00:00', '2017-05-03 10:24:25+00:00', 2, 'beginner'),
	(3, 'Octopus 3', 'The Octopus series is an exciting series of 3 progressive awards specifically designed for child aged between 5 to 8 years old.', 'Swimming teacher or assistant in water is optional. Buoyancy aids may be used.', '2017-05-03 09:41:00+00:00', '2017-05-03 09:41:00+00:00', 2, 'beginner'),
	(4, 'Goldfish 1', 'This programme is designed to be the next stage for swimmers who have progressed through either the STAnley First Steps Series or Octopus Series.', 'Buoyancy aids may not be used, unless stated. Learners may work towards the 5 metre Distance award and I Can Swim or Good Stroke badges.', '2017-05-03 17:58:06+00:00', '2017-05-03 17:58:06+00:00', 2, 'beginner'),
	(5, 'Goldfish 2', 'This programme is designed to be the next stage for swimmers who have progressed through either the STAnley First Steps Series or Octopus Series.', 'Buoyancy aids may not be used, unless stated. Learners may work towards the 10 metre Distance award and Kingfisher 1.', '2017-05-03 17:58:14+00:00', '2017-05-03 17:58:15+00:00', 2, 'beginner'),
	(6, 'Goldfish 3', 'This programme is designed to be the next stage for swimmers who have progressed through either the STAnley First Steps Series or Octopus Series.', 'Buoyancy aids may not be used, unless stated. Learners may work towards the 15 metre Distance award and Kingfisher 1.', '2017-05-03 17:58:23+00:00', '2017-05-03 17:58:23+00:00', 2, 'beginner'),
	(7, 'Angelfish 1', 'Once swimmers have completed the Goldfish Series they can progress to the Angelfish Series. On completion of the 3 progressive awards in this series, swimmers will be capable of swimming 25 metres without aid, perform butterfly stroke as well as mastering sculling techniques and entries to the water.', 'Buoyancy aids may not be used, unless stated. Learners may work towards the 15 metre Distance award and Kingfisher 2.', '2017-05-10 11:24:09+00:00', '2017-05-10 11:24:10+00:00', 2, 'intermediate'),
	(8, 'Angelfish 2', 'Once swimmers have completed the Goldfish Series they can progress to the Angelfish Series. On completion of the 3 progressive awards in this series, swimmers will be capable of swimming 25 metres without aid, perform butterfly stroke as well as mastering sculling techniques and entries to the water.', 'Buoyancy aids may not be used, unless stated. Learners may work towards the 20 metre Distance award and Kingfisher 2.', '2017-05-10 11:24:19+00:00', '2017-05-10 11:24:19+00:00', 2, 'intermediate'),
	(9, 'Angelfish 3', 'Once swimmers have completed the Goldfish Series they can progress to the Angelfish Series. On completion of the 3 progressive awards in this series, swimmers will be capable of swimming 25 metres without aid, perform butterfly stroke as well as mastering sculling techniques and entries to the water.', 'Buoyancy aids may not be used, unless stated. Learners may work towards the 25 metre Distance award and Kingfisher 1 or Good Stroke badges.', '2017-05-10 11:24:26+00:00', '2017-05-10 11:24:26+00:00', 2, 'intermediate');
